import React, {Component} from 'react';
import Button from './Button';

export default class ApplicantCard extends Component {

    render() {
        const {applicant} = this.props;
        return (<div className="card col-lg-3 col-md-4 col-sm-12">
            <img className="card-img-top" src={applicant.applicantPicture} />
            <div class='card-body'>
                <h4 class='card-title'>
                    {applicant.applicantFirstName + " " + applicant.applicantLastName}
                </h4>
                <div class='row'>
                    <div class='col-md-6'>
                        <Button />
                    </div>
                    <div class='col-md-6'>
                        <Button />
                    </div>
                </div>
            </div>
        </div>);
    }
}
